import React from "react";
import { useContext } from "react";
import App, { AppContext } from "../App";

export const Home = (props) => {
  const {} = useContext(AppContext);
  return (
    <div>
      <h1>This is the homepage.</h1>
      <h2>Username = {props.username}</h2>
    </div>
  );
};
